import { Redirect } from "react-router";

const Multiplayer = ({ token }) => {

if (!token) {
    return <Redirect to='/' />
}

    return (
        <>
            <div className='multibody' >
                <div>
                    <ul className='messages' />
                </div>

                <form className='form' action=''>
                <input
                    className='input'  
                    type='text'
                    autoComplete='off'
                    placeholder='What would you like to say?'
                    >
                </input>
                <button>
                    Send
                </button>
                </form>
            </div>
        </>
    );
}

export default Multiplayer;
